import logo from './logo.svg';
import iphone from './ressources/iphonex.png';

function Product(){
    return(

        <div class="card w-50">
            <img src="/ressources/" class="card-img-top" alt="alt-image-cap" id="product-photo"/>
            <div class="card-body">
                <h4 class="card-title mb-3">6000 kr</h4>
                <h6 class="card-text mb-2">Pent brukt Iphone X</h6>
                <p class="card-subtitle mb-4 text-muted">Bergen</p>
                <div class="text-center">
                    <a class="btn btn-primary ">Send Message</a>
                </div>
            </div>
        </div>

    
    );
}

export default Product;
